		05E55C5417C9ACDF00BC8510 /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.framework";
			fileType = pattern.proxy;
			isEditable = 1;
			outputFiles = (
				"$(DERIVED_FILES_DIR)/$(CURRENT_ARCH)/$(INPUT_FILE_BASE)/header-stamp.h",
			);
			script = "DEST=\"${DERIVED_FILES_DIR}/${CURRENT_ARCH}/${INPUT_FILE_BASE}\"\nSTAMP=\"${DEST}/header-stamp.h\"\nif [ \"${STAMP}\" -nt \"${INPUT_FILE_PATH}\" ]; then\n    exit 0\nfi\n\nmkdir -p \"${DEST}\"\n${SRCROOT}/bin/class-dump --arch \"${CURRENT_ARCH}\" -H \"${INPUT_FILE_PATH}\" -o \"${DEST}\"\n\n# Special case objects/protocols that are otherwise redefined.\n# We may be able to handle this better by finding the implementing framework for a symbol\n# and checking for a valid header; in the meantime, this works without too much hassle.\nis_cocoa() {\n    case \"$1\" in\n        NSObject) echo 1;;\n        NSToolbarDelegate) echo 1;;\n        NSWindowRestoration) echo 1;;\n        *) echo 0;;\n    esac\n}\n\npushd \"${DEST}\" >/dev/null\n# Fix up any bad method names\nfor f in *.h; do\n    sed 's/\\.cxx_destruct/_cxx_destruct/g' < \"${f}\" > \"${f}.new\"\n    mv \"${f}.new\" \"${f}\"\ndone\n\n# Generate stub headers for any missing headers\nfor f in `grep -h -E '^#import[ \\t.*]\"' *.h | sort | uniq  | cut -f 2 -d ' ' | awk -F \\\" '{print $2}'`; do\n    if [ ! -f \"${f}\" ]; then\n        base=$(echo \"$f\" | sed 's/\\.h$//g')\n        if [ \"$(is_cocoa ${base})\" = 1 ]; then\n            echo '#import <Cocoa/Cocoa.h>' > \"${f}\"\n        elif [ -f \"${base}-Protocol.h\" ]; then\n            echo \"#import \\\"${base}-Protocol.h\\\"\" > \"${f}\"\n        else\n            # Try to find a working header ...\n            echo '#import <Cocoa/Cocoa.h>' > \"${f}\"\n        fi\n    fi\ndone\npopd >/dev/null\n\ntouch \"${STAMP}\"";
		};
